syntax = "proto3";
message T0 {
  repeated uint32 t0=1;
  repeated bytes t1=2;
}
message T1 {
  bytes t0=1;
  bytes t1=2;
  bytes t2=3;
}
message T2 {
  repeated uint32 t0=1;
}
message T3 {
  bytes t0=1;
  repeated uint32 t1=2;
}
message T4 {
  string t0=1;
}
message T5 {
  string t0=1;
  string t1=2;
}
message T6 {
  sint32 t0=1;
  uint32 t1=2;
  uint32 t2=3;
  uint32 t3=4;
  string t4=5;
  string t5=6;
  uint32 t6=7;
  string t7=8;
  uint32 t8=9;
  uint32 t9=10;
}